import React from 'react';
import './PopisBodova.css'; // Pretpostavljamo da CSS pravila definirate u zasebnoj datoteci

function PopisZivotinja() {
    // Testni podaci o životinjama
    const zivotinje = [
        { naziv: 'Lav', opis: 'Kralj životinja, obitava u Africi.', id: 1 },
        { naziv: 'Panda', opis: 'Rijetka medvjedasta životinja iz Kine.', id: 2 }
    ];

    return (
        <div className="popis-bodova-container">
            <header className="header">
                <h1>Životinje</h1>
            </header>
            <table className="user-list">
                <thead>
                    <tr>
                        <th>Naziv</th>
                        <th>Opis</th>
                        <th>Akcije</th>
                    </tr>
                </thead>
                <tbody>
                    {zivotinje.map(zivotinja => (
                        <tr key={zivotinja.id}>
                            <td>{zivotinja.naziv}</td>
                            <td>{zivotinja.opis}</td>
                            <td>
                                <button className="icon-button edit-button">
                                    <i className="edit-icon">✎</i> {/* Zamijenite s pravom ikonom za uređivanje */}
                                </button>
                                <button className="icon-button checkbox-button">
                                    <i className="checkbox-icon">☐</i> {/* Zamijenite s pravom ikonom za checkbox */}
                                </button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default PopisZivotinja;
